// define a function that takes a string as input and returns an integer
function f_gold(s) {
    // initialize a counter object to count the frequency of each character in the string
    var n = s.length;
    var counter = {};
    for (var i = 0; i < n; i++) {
        if (counter[s[i]]) {
            counter[s[i]] += 1;
        } else {
            counter[s[i]] = 1;
        }
    }
    // count the number of characters with odd frequency
    var odd_cnt = 0;
    for (var key in counter) {
        if (counter[key] % 2 == 1) {
            odd_cnt += 1;
        }
    }
    // return the length of the string if all characters have even frequency, otherwise return the length minus the number of characters with odd frequency plus one
    return (odd_cnt == 0) ? n : n - odd_cnt + 1;
}
